export default function Question() {
    return (
        <div className="question-container">
            <h2 className="question">What is the default behavior of React when rendering a list?</h2>
            <div className="options">
                <button className="option">Keys</button>
                <button className="option">Refs</button>
                <button className="option">State</button>
                <button className="option">Props</button>
            </div>
        </div>
    );
}
